    false,nt"url": null,nt"notes": "Caribou (Rangifer tarandus granti) occurred
    on LANDSAT vegetation types (LVT) f loaded- tundra, intermediate wet-moist, and
    sedge tundra most often during precalving. It is not known whether or not the class
    flooded tundra was truly flooded as breakup in 1980 did not occur the same week
    as when the LANDSAT image was taken (1974). Surveys 2-4 show a marked occurrence
    on sedge tundra with tussock or Dryas-heath ranking second. Occurrence on all other
    types was low. Survey 5 and 6 showed occurrence greatest on-Dryas-heath with occurrence
    on sedge and- tussock tundra declining sharply.",nt"license_title": "License
